object Solution {
    def beautifulSubstrings(s: String, k: Int): Long = {
        val n = s.length
        val vowels = Set('a', 'e', 'i', 'o', 'u')
        val dp = Array.ofDim[Int](n + 1, 2)
        var count = 0L

        for (i <- 1 to n) {
            dp(i)(0) = dp(i - 1)(0)
            dp(i)(1) = dp(i - 1)(1)

            if (vowels.contains(s(i - 1))) dp(i)(0) += 1 else dp(i)(1) += 1

            for (j <- 0 until i) {
                val vowelCount = dp(i)(0) - dp(j)(0)
                val consonantCount = dp(i)(1) - dp(j)(1)

                if (vowelCount == consonantCount && (vowelCount * consonantCount) % k == 0) count += 1
            }
        }

        count
    }
}
